- input: "TEXT\x1CC00547786\x1C1\x1C\x1CF3A\x1CJanuary 15, 2014  RE:  \tFEC Letter
    dated December 20, 2103 regarding C00547786 Krinkie for Congress October Quarterly
    Report   In response to the above noted letter, I respectfully submit the following
    explanations.   Issue 1: Contributions from Krinkie Company.  Despite the name,
    the Krinkie Company is legally organized as a partnership, with Philip Krinkie
    (the Candidate) as a majority partner.  The partnership has determined that the
    contributions are to be attributed 100% to Philip Krinkie and will be reflected
    on the partnership as such.  The quarterly FEC report has been revised and amended
    to more accurately reflect this information.   Issue 2: Employer/Occupation information
    for donors:  Information for numerous donors appears to have dropped off in the
    process of importing the data and was missed in my pre-submission review. This
    data has been re-entered for the amended report.  We include a request for the
    needed information with all fundraising requests on a pre-printed card.  For those
    who do not submit the information, a follow up is included with the thank you
    letter, and if needed, a phone call or email is utilized as the additional follow
    up.   Please contact me via email at cej@usfamily.net should you need additional
    information.   Best regards, Carl Jacobson,  Treasurer Krinkie for Congress\n"
